references:
Theo thứ tự chuẩn của các phép tính, phép chia xảy ra trước phép trừ. Chúng tôi thấy rằng câu trả lời của chúng tôi là \begin{align*}
8-4 \div 2 - 1 &= 8-2-1 \\
&= 6-1 \\
&= \đóng hộp{5}.
\end{căn chỉnh*}

Chúng tôi lấy điểm trung bình của sáu điểm sau: \begin{align*}
\frac{70 + 80 + 90 + 75 + 80 + 85}{6} &= \frac{(70 + 90) + 80 + 80 + (75 + 85)}{6}\\
&= \frac{(80 + 80) + 80 + 80 + (80 + 80)}{6}\\
&= \frac{6\cdot 80}{6}\\
&= \đóng hộp{80}.
\end{căn chỉnh*}

Thay vì thực hiện từng phép chia riêng biệt rồi cộng lại, hãy nhớ rằng $x\div d + y\div d = (x+y)\div d $ nếu $d$ khác 0. Sử dụng thực tế này, chúng ta có thể tính toán như sau: \begin{align*}
49{,}994\div 7 + 20{,}006\div 7 &= (49{,}994 + 20{,}006) \div 7\\
&= 70{,}000\div 7\\
&=\đóng hộp{10{,}000}.
\end{căn chỉnh*}

Vì các góc trong một tam giác cộng lại với $180^\circ,$ nên góc còn thiếu trong tam giác là $180^\circ-50^\circ-60^\circ=70^\circ.$ Khi đó chúng ta có: [asy]
draw((0,0)--(3,0)--(1,2.5)--cycle);
label("$60^\circ$",(2.9,0),NW);
nhãn("$50^\circ$",(1.1,2.2),S);
label("$x^\circ$",(0,0),SW);
draw((-1,0)--(0,0));
draw((0,0)--(-.5,-1.25));
nhãn("$A$",(-1,0),W);
nhãn("$B$",(3,0),E);
nhãn("$C$",(1,2.5),N);
nhãn("$D$",(-.5,-1.25),S);
label("$X$",(0,0),NW);
[/asy] Vì $\angle BXC=70^\circ,$ thì $\angle AXC = 180^\circ - \angle BXC = 110^\circ.$

Vì $\angle AXC = 110^\circ,$ nên $\angle DXA = 180^\circ - \angle AXC = 70^\circ.$

Do đó, $x=\boxed{70}.$

(Ngoài ra, chúng ta có thể lưu ý rằng khi hai đường thẳng cắt nhau, các góc đối đỉnh bằng nhau nên $\angle DXA=\angle BXC =70^\circ.$)

Đầu tiên, chúng ta thực hiện thao tác trong ngoặc đơn: \[6+5-4\times 3\div (2+1) = 6+5-4\times 3\div 3.\] Sau đó, chúng ta thực hiện phép nhân và chia, đi từ trái sang phải: \begin{align*}
6+5-4\times 3\div 3 &= 6+5-12 \div 3 \\
&=6+5-4.
\end{align*} Cuối cùng, chúng ta thực hiện phép cộng và trừ, đi từ trái sang phải để có kết quả: \begin{align*}
6+5-4 &= 11-4 \\
&=\được đóng hộp{7}.
\end{căn chỉnh*}

Chúng ta thiết lập phương trình và giải $x$. \bắt đầu{căn chỉnh*}
2x+7&=81\quad\Rightarrow\\
2x&=74\quad\Rightarrow\\
x&=\đóng hộp{37}
\end{căn chỉnh*}

Chúng ta thực hiện theo thứ tự thao tác: \begin{align*}
92 - 45 \div (3\times 5) - 5^2 &= 92 - 45 \div 15 - 5^2 \\
&= 92 - 45\div 15 -25 \\
&= 92 - 3 - 25=89-25 = \boxed{64}.
\end{căn chỉnh*}

Áp dụng thứ tự thực hiện sẽ có được \begin{align*}
3\cdot 3 +3(3+3) - 3^3 &= 3\cdot 3 +3(6) - 3^3\\
&= 3\cdot 3 + 3(6) - 27\\
&= 9 + 18 - 27 = \boxed{0}.
\end{căn chỉnh*}

fewshot.problem:
Trong sơ đồ, giá trị của $x$ là bao nhiêu? [asy]
kích thước (120);
draw(Circle((0,0),1));
draw((0,0)--(.5,sqrt(3)/2));
draw((0,0)--(sqrt(3)/2,.5));
draw((0,0)--(sqrt(3)/2,-.5));
draw((0,0)--(-1,0));
label("$4x^\circ$",(0,0),NNW); label("$5x^\circ$",(0,0),SSW);
label("$2x^\circ$",(.3,0));label("$x^\circ$",(.3,.3));

[/asy]

Giá trị của $x$ trong hình vẽ trên mặt phẳng là bao nhiêu?

[asy]
cặp A;
draw(dir(40)--A); draw(dir(200)--A); draw(dir(300)--A);
label("$160^{\circ}$",A,dir(120)); label("$x^{\circ}$",A,dir(250)); label("$x^{\circ}$",A,dir(350));
[/asy]

fewshot.solution:
Theo thứ tự thực hiện (tính tổng theo $(4+8)^2$ trước khi áp dụng số mũ của $(4+8)^2$), chúng ta có \begin{align*}
(4+8)^2 + (4^2 + 8^2) &= (12)^2 + (4^2 + 8^2)\\
&= 144 + (16+64) \\
&= 144+ 80 \\
&= \đóng hộp{224}.\end{align*}
